import './Logement.css';

function Logement({ properties }) {

  return (
    <div>
       {properties.map((property) => (
        <div key={property.id}>
          <h2>{property.address}</h2>
          <p>Type : {property.type}</p>
          <p>Prix : {property.price} euros</p>
        </div>
      ))}
    </div>
  );

}

export default Logement;
